import AddIcon from '@material-ui/icons/Add';
const MyAcccord = ((props)=>{
    return (<>
        <div className="main">

        <div className="main-heading">Recent InterView Question</div>
        <p><AddIcon/></p><h3>{props.question}</h3>


        : {props.answer}
        
        </div>
    </>)

})
export  default MyAcccord
